import {useState,useEffect} from 'react';

function App(){
    const [content,setContent]=useState('')

    function getContent(){
        fetch("/home").then((res)=>{
            return res.json()
        }).then((data)=>{
            console.log(data)
            setContent(data.data)
        })
    }

    return(
        <div>
            <p>{content}</p>
            <button onClick={getContent}>click me</button>
        </div>
    )
}

export default App
